import pandas as pd
import numpy as np
import matplotlib.pyplot as plt

import numpy as np
from sklearn import svm
import pickle

def clean_csv(target):
    df = pd.read_csv('../../static/readings/'+target+'.txt',delimiter="\t")

    df2 = pd.DataFrame(np.zeros((0, 401)))
    df2 = pd.concat([df2,pd.DataFrame(columns=['sample'])])

    #print(df2)
    for row in range(0,len(df.index)):#51):
        #df2.loc(row, ['sample'])='1'
        sample_value = df.loc[row, ['sample']].values[0]
        row_values = df.loc[row,['values_str']].values[0]
        row_values = row_values.replace('[', '')
        row_values = row_values.replace(']', '')
        row_values = row_values.strip().split(",")

        row_values = [float(x) for x in row_values]
        #print(type(row_values))
        #print('lenrow_values',len(row_values))
        row_values.append(sample_value)
        #print('lenrow_values',len(row_values))

        #.tolist()
        #print('row_values',row_values)

        ## Save each value in each column?


        #for value in row_values:
            #print(value)
            #print(type(value))

        #print(len(row_values))


        df2_cols = list(df2.columns.values)

        df2 = df2.append(pd.Series(row_values, index=df2_cols), ignore_index=True)
        #print('df2_here',df2)
        df2.ix[row, 'sample'] = sample_value
    df2.to_csv('cleaned_data/'+target+'.txt', sep ='\t')
    #print('df2_query',df2.query('sample == 1'))
    ## print('sample 1',df2[df2.sample == '1'])
    #plt.figure()
    #df2.query('sample == 1').plot()
    #df2[df2['sample']==1].plot()
    #plt.show()

def get_sample(target, sample_id, sample_position):
    df = pd.read_csv('./cleaned_data/'+target+'.txt',delimiter="\t")
    #Read 3 samples
    subset_df=df.query('sample == @sample_id')
    sample = subset_df.iloc[sample_position]#loc[0,:]
    return sample.values.tolist()[1:402]

def test(clf, target):
    df = pd.read_csv('./cleaned_data/' + target + '.txt', delimiter="\t")
    #print('df',df)
    prediction = []
    correct = []
    incorrect = []
    for i in range(0,len(df.index)):
        sample = df.iloc[i]#loc[0,:]
        test_sample = sample.values.tolist()[1:402]
        pred = clf.predict([test_sample])[[0]].item(0)

        if pred == target:
            correct.append(pred)
        else:
            incorrect.append(pred)
        prediction.append(clf.predict([test_sample]))
    print('prediction',prediction)
    print('total correct', len(correct))
    print('total incorrect', len(incorrect))
    accuracy = len(correct)/(len(incorrect)+len(correct))
    print('accuracy', accuracy)

    return prediction, accuracy

if __name__ == '__main__':
    targets = ['chicken', 'paprika', 'apples_green']
    sample_ids= range(1,2)
    sample_positions=range(0,3)
    X=[]
    y=[]
    for target in targets:
        clean_csv(target)

    for target in targets:
        for sample_id in sample_ids:
            print('target', target)
            print('sample_id', sample_id)
            for sample_position in sample_positions:
                X.append(get_sample(target, sample_id, sample_position))
                y.append(target)
        print('X',X)
    print('y',y)

    #Linear kernel
    #clf = svm.SVC()

    #Radial kernel
    clf = svm.SVC(C = 0.20, kernel ='linear', degree = 3, gamma ='auto')

    #Train the model
    clf.fit(X, y)

    '''Save model'''
    filename = 'finalized_model.sav'
    pickle.dump(clf, open(filename, 'wb'))


